	//Formato de fecha para comparaciones
	function fechaCorta(fecha){ return $filter('date')(new Date(fecha), "yyyyMdd"); }
	$scope.fechaCorta = fechaCorta;
	
	//Cambiar valor de adquisición
	$scope.adquisicion = function(r){
		var adquisicion = (r.adquirido === 0) ? 1 : 0;
		var cambio = false;
		
		//Mensaje de información
		var msg = 'Fecha de registro:\n' + moment(r.fecha_registro).format('MMMM MM, YYYY - h:mm a') + ' \n\nFecha adquisición:\n' + moment(r.fecha_adquisicion).format('MMMM MM, YYYY - h:mm a');
		
		if(adquisicion === 0 && confirm('Confirme el cambio de adquisición:\n' + msg)) cambio = true; //Remover
		else if(adquisicion == 1) cambio = true;
		
		if(cambio)
		{
			r.adquirido = adquisicion;
			r.fecha_adquisicion = new Date();
		}
		
		$('.clicking').removeClass('clicking');
	};
	
	/*Eliminación de registro*/
	$scope.eliminar = function(r){
		if(confirm('Confirme la eliminación de este registro:\n' + r.titulo + ' #' + r.volumen))
		{
			var eliminado = false;
			var precio = 0;
			var momentObj = moment(r.fecha);
			var agno = momentObj.year();
			var mes = momentObj.month() + 1;
			var dia = momentObj.date();
			
			for(var key in $scope.registros[agno])
			{
				if($scope.registros[agno][key].id == r.id)
				{
					precio = $scope.registros[agno][key].precio;
					$scope.registros[agno].splice(key, 1);
					eliminado = true;
					break;
				}
			}
			
			//Eliminar fechas vacías
			if(eliminado)
			{
				delete $scope.registros[agno][r.id];
				if($scope.objsize($scope.registros[agno]) == 0)
				{
					delete $scope.registros[agno];
					delete $scope.fechas[agno];
				
					//Si no hay año, seleccionar año disponible
					if($scope.objsize($scope.fechas) > 0) $scope.pestanaAgnoActivo($scope.keysReversed($scope.fechas)[0]);
				}
				
				$scope.sumar(agno, mes, dia, -precio);
				$('.comic-modal').modal('hide');
			}
			else alert('Ha ocurrido un error. Intente de nuevo más tarde.');
		}
		else $('.clicking').removeClass('clicking');
	};
	
	//FORMULARIO > Registrar. Validar y toda la cosa
	$scope.registrar = function(desdeMisComics) {
		if(angular.isUndefined(desdeMisComics)) desdeMisComics = false;
		if(!desdeMisComics) $scope.nuevo.titulo = $('#nuevo_titulo').val(); //Reparar valores del arreglo $scope.nuevos. Corta los valores del título y no sé porqué :(
		if($scope.nuevo.titulo.length > 0 && $scope.nuevo.volumen !== null && $scope.nuevo.precio !== null)
		{
			$scope.nuevo.id = code($scope.nuevo);
			$scope.fecha = moment($scope.nuevo.fecha);
			
			//Establacer objetos de fecha para ayudar en los filtrados
			var momentObj = moment($scope.nuevo.fecha);
			$scope.nuevo.agno = momentObj.year();
			$scope.nuevo.mes = momentObj.month() + 1;
			$scope.nuevo.dia = momentObj.date();
			$scope.nuevo.fecha_registro = (typeof $scope.nuevo.fecha_registro == 'undefined') ? new Date() : new Date($scope.nuevo.fecha_registro);
			$scope.nuevo.fecha_adquisicion = ($scope.nuevo.adquirido == 1) ? $scope.nuevo.fecha_registro : 'No definido';
			
			//Verificar que no esté duplicado
			var repetido = false;
			var repetido_info;
			for(var agno in $scope.registros)
			{
				for(var i in $scope.registros[agno])
				{
					if($scope.registros[agno][i].id == $scope.nuevo.id)
					{						
						repetido = true;
						repetido_info = $scope.registros[agno][i];
						break;
					}
				}
				if(repetido) break;
			}
			
			//Insertar
			if(!repetido)
			{
				//Agregar
				if(typeof $scope.registros[$scope.nuevo.agno] == 'undefined') $scope.registros[$scope.nuevo.agno] = [];
				// $scope.registros[$scope.nuevo.agno][$scope.nuevo.id] = $scope.nuevo;
				$scope.registros[$scope.nuevo.agno].push($scope.nuevo);
				
				//Crear objetos de fecha
				if(typeof $scope.fechas[$scope.nuevo.agno] == 'undefined') $scope.fechas[$scope.nuevo.agno] = {};
				if(typeof $scope.fechas[$scope.nuevo.agno][$scope.nuevo.mes] == 'undefined') $scope.fechas[$scope.nuevo.agno][$scope.nuevo.mes] = [];
				if($scope.fechas[$scope.nuevo.agno][$scope.nuevo.mes].indexOf($scope.nuevo.dia) < 0)
				{
					$scope.fechas[$scope.nuevo.agno][$scope.nuevo.mes].push($scope.nuevo.dia);
					$scope.fechas[$scope.nuevo.agno][$scope.nuevo.mes] = $scope.fechas[$scope.nuevo.agno][$scope.nuevo.mes].sort(function(a, b){return b-a});
				}
				
				//Ingresar a sumatorias
				$scope.sumar($scope.nuevo.agno, $scope.nuevo.mes, $scope.nuevo.dia, $scope.nuevo.precio);
				
				//TypeAhead
				if($scope.typeOptions.indexOf($scope.nuevo.titulo) < 0) $scope.typeOptions.push($scope.nuevo.titulo);
				$scope.typeAheadSet();

				if(dbug) c('Insertado :) ');
				
				$scope.nuevo = vacio();
				$('#nuevo_titulo').val($scope.nuevo.titulo); //Setear valor del campo de título, que no se refresca :(
			}
			else //Está duplicado
			{
				var conVariante = ($scope.nuevo.variante.length > 0) ? ' (Variante de ' + $scope.nuevo.variante + ')' : '';
				if(typeof navigator != 'undefined') navigator.vibrate(2000)
				alert('Wow wow wow!\n¡Este ya lo tienes!\n' + $scope.nuevo.titulo + conVariante + ' #' + $scope.nuevo.volumen + ' ($' + repetido_info.precio + '.00)\n' + $filter('date')(repetido_info.fecha, 'longDate'));
				if(dbug) c('REPETIDO :( ' + $scope.nuevo.titulo);
			}
		}
	};

